import React from 'react';
import './Header.css';  // 스타일 시트 임포트

function Header({ onChangePage }) {
  return (
    <header className="header">
      <button onClick={() => onChangePage('production')}>생산 실적 등록</button>
    </header>
  );
}

export default Header;
